// frontend/src/components/Results.js
import React from 'react';
import './Results.css';

const Results = ({ result }) => {
    if (!result) return null;

    return (
        <div>
            <h4>Instrumento Detectado</h4>
            <p><strong>Instrumento:</strong> {result.instrument}</p>
            <h5>Probabilidades:</h5>
            <ul>
                {result.probabilities.map((prob, index) => (
                    <li key={index}>
                        Clase {index + 1}: {(prob * 100).toFixed(2)}%
                    </li>
                ))}
            </ul>
            {result.spectrogram && (
                <img src={`data:image/png;base64,${result.spectrogram}`} alt="Espectrograma" />
            )}
        </div>
    );
};

export default Results;
